shaders.vertex:
attribute vec4 aVertex;
attribute vec4 aTexCoord;
varying vec4 vTexCoord;

void main(void)
{
    vTexCoord = aTexCoord;
    gl_Position = aVertex;
}

shaders.fragment:
// Game Of Life
// Created by John Horton Conway, 1970
// http://de.wikipedia.org/wiki/Conways_Spiel_des_Lebens

varying vec4 vTexCoord;
uniform sampler2D uTexture;
uniform float uT;
uniform vec2 uResolution;
uniform vec2 uMouse;
uniform bool uFade; // true

// Copyright (c) 2008 Tristan Macdonald
// Distributed under the Boost Software License, Version 1.0
// (see http://www.boost.org/LICENSE_1_0.txt)

void main(void)
{
  vec2 d = vec2(1.0, 1.0) / uResolution;
  vec2 c = vTexCoord.st;
  vec3 rgb = texture2D(uTexture, c).rgb; 
  // count alive neighbours
  vec3 n = vec3(0.0);
  n += vec3(greaterThan(texture2D(uTexture, c+d*vec2(-1,-1)).rgb, vec3(0.0)));
  n += vec3(greaterThan(texture2D(uTexture, c+d*vec2(-1, 0)).rgb, vec3(0.0)));
  n += vec3(greaterThan(texture2D(uTexture, c+d*vec2(-1, 1)).rgb, vec3(0.0)));
  n += vec3(greaterThan(texture2D(uTexture, c+d*vec2( 0,-1)).rgb, vec3(0.0)));
  n += vec3(greaterThan(texture2D(uTexture, c+d*vec2( 0, 1)).rgb, vec3(0.0)));
  n += vec3(greaterThan(texture2D(uTexture, c+d*vec2( 1,-1)).rgb, vec3(0.0)));
  n += vec3(greaterThan(texture2D(uTexture, c+d*vec2( 1, 0)).rgb, vec3(0.0)));
  n += vec3(greaterThan(texture2D(uTexture, c+d*vec2( 1, 1)).rgb, vec3(0.0))); 
  // check if the current pixel is alive
  vec3 alive = vec3(greaterThan(rgb, vec3(0.0))); 
  // resurrect if not alive but neighbored by 3 alive cells
  rgb += (vec3(1.0)-alive) * vec3(equal(n, vec3(3.0))); 
  // kill if not neighbored by either 2 or 3
  rgb *= vec3(equal(n, vec3(2.0))) + vec3(equal(n, vec3(3.0)));
  // fade the current pixel as it ages
  if (uFade)
    rgb -= vec3(greaterThan(rgb, vec3(0.4)))*0.05;
  // write out the pixel
  gl_FragColor = vec4(rgb, 1.0);
}
